import { Routes, Route,  BrowserRouter} from "react-router-dom";
import Home from "../Home";

function App() {
  return (
    <div className="App">

      <BrowserRouter>
        <Routes>
          <Route exact path="/" element={<Home />}>
            <Home/>
          </Route>
        </Routes>
      </BrowserRouter>

    </div>
  );
}

export default App;
